import React from "react";

function Project() {
  return (
    <div className="contenedor-projects">
      <img
        className="imagen-project" 
        src={require("../imgs/project-shawn.png")}
        alt="Foto de Shawn"/>
        <div className="contenedor-texto-project">
          <p className="nombre-project">Ahorcado en PHP</p>
          <p className="tiempo-project">1 Hora - Tiempo estimado</p>
          <p className="descripcion-project">Basicamente este es un proyecto muy pero que muy simple en el que se crea un Ahorcado en PHP. EL tipico juego. Pero hecho con programacion orientada a objetos</p>
        </div>
    </div>
  );
}

export default Project;
